import React, { useState } from 'react';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import Dashboard from './components/Dashboard';
import Iniciogoogle from './components/Iniciogoogle';
import Loginsesion from './components/Loginsesion';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './styles/App.css';

function App() {
  const [view, setView] = useState('login'); // 'login', 'register', 'dashboard', 'profile'

  const toggleView = (newView) => {
    setView(newView);
  }; 

  return (
      <Router>
        <div className="App">
          <Switch>
            <Route exact path="/" component={Login} />
            <Route path="/register" component={Register} />
            <Route path="/iniciogoogle" component={Iniciogoogle} />
            <Route path="/loginsesion" component={Loginsesion} />
            <Route path="/dashboard" component={Dashboard} />
            <Route path="/profile" component={Profile} />
          </Switch>
        </div>
      </Router>
    );
} 

export default App;
